import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <div className="footer">
      <div className="pic1">
        <img src="./images/swiper_img.jpg" alt="스와이퍼" className="swiper1" />
        <img
          src="./images/swiper_img.jpg2"
          alt="스와이퍼"
          className="swiper2"
        />
      </div>
    </div>
  );
};

export default Footer;
